import React from "react";
import Header from "./Header";

const Four = () => {
  return (
    <>
      <Header title={"배경 선택"} />
      <div className="container">
        <div className="four-container"></div>
      </div>
      <div className="footer-container">
        <Header />
      </div>
    </>
  );
};

export default Four;
